1. Download and then extract ccsetup25-1.exe
2. Run the installer and follow through setup
3. Enjoy the game!


&quot;Remote control bodies and machines to harvest gold and beat your competitors! 2D sidescrolling pixel graphics with an extremely detailed physics simulation make for a mix of nostalgia and surprising gameplay.&quot;

Features up to 4 player co-op, fantastic AI and amazing physics with fully destructible environments and NPCs.

Build 25 has functional campaign, plenty of skirmish modes and in-game editors.

